ControlPropertyState.AutoRuleBindingString:
If(
    ComboBox1.Selected.Value = "Số lượng đơn nhập được tạo",
    UpdateContext({}),
    If(
        ComboBox1.Selected.Value = "Số lượng đơn xuất được tạo",
        UpdateContext({}),
        If(
            ComboBox1.Selected.Value = "Thống kê theo trạng thái đơn nhập",
            UpdateContext({ShowTT_NX: true});
            ClearCollect(
                TT_NX,
                Table(
                    {
                        ID: 1,
                        statusN: "Chờ duyệt",
                        quantity: {
                            Value: CountIf(
                                'mWarehouse.Imports',
                                status.Value = "Chờ duyệt"
                            )
                        }
                    },
                    {
                        ID: 2,
                        statusN: "Đơn hàng",
                        quantity: {
                            Value: CountIf(
                                'mWarehouse.Imports',
                                status.Value = "Đơn hàng"
                            )
                        }
                    },
                    {
                        ID: 3,
                        statusN: "Từ chối",
                        quantity: {
                            Value: CountIf(
                                'mWarehouse.Imports',
                                status.Value = "Từ chối"
                            )
                        }
                    },
                    {
                        ID: 4,
                        statusN: "Hoàn thành",
                        quantity: {
                            Value: CountIf(
                                'mWarehouse.Imports',
                                status.Value = "Hoàn thành"
                            )
                        }
                    }
                )
            );
            ,
            If(
                ComboBox1.Selected.Value = "Thống kê theo trạng thái đơn xuất",
                UpdateContext({ShowTT_NX: true});
                ClearCollect(
                TT_NX,
                Table(
                    {
                        ID: 1,
                        statusN: "Chờ duyệt",
                        quantity: {
                            Value: CountIf(
                                'mWarehouse.Exports',
                                status.Value = "Chờ duyệt"
                            )
                        }
                    },
                    {
                        ID: 2,
                        statusN: "Đơn hàng",
                        quantity: {
                            Value: CountIf(
                                'mWarehouse.Exports',
                                status.Value = "Đơn hàng"
                            )
                        }
                    },
                    {
                        ID: 3,
                        statusN: "Từ chối",
                        quantity: {
                            Value: CountIf(
                                'mWarehouse.Exports',
                                status.Value = "Từ chối"
                            )
                        }
                    },
                    {
                        ID: 4,
                        statusN: "Hoàn thành",
                        quantity: {
                            Value: CountIf(
                                'mWarehouse.Exports',
                                status.Value = "Hoàn thành"
                            )
                        }
                    }
                )
            );
                ,
                If(
                    ComboBox1.Selected.Value = "Số lượng sản phẩm đã được cập nhật theo thời gian",
                    UpdateContext({})
                )
            )
        )
    )
)
